                </div>
                <div className="col-md-4 text-center">
                    <h1 style={{color: 'white'}}>Dashboard</h1>
                    <h4>Welcome John!</h4>
                </div>
                <div className="col-md-4">
                </div>
            </div>
        </div>
    )
};

export default Dashboard;
